// src/App.js
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignupAndLogin from './components/SignupAndLogin';
import Dashboard from './components/Dashboard';
import ProductManagement from './components/ProductManagement';  // Import the Product Management component
import UserManagement from './components/UserManagement';      // Import the User Management component
import './Style.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignupAndLogin isLogin={false} />} />
        <Route path="/signup" element={<SignupAndLogin isLogin={false} />} />
        <Route path="/login" element={<SignupAndLogin isLogin={true} />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/products" element={<ProductManagement />} />   {/* Product Management route */}
        <Route path="/users" element={<UserManagement />} />         {/* User Management route */}
      </Routes>
    </Router>
  );
}

export default App;
